import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Button } from 'react-bootstrap';
import Avatar from 'react-avatar';
import './Login.css';
import avatar from './image.png';
import { Formik } from 'formik';
import * as yup from 'yup';
const Login = () => (
    <Formik
    initialValues={{
        UserName:'',
        Password:''
    }}
    onSubmit={(value)=>
    {
        console.log("The values are",value);
    }}
    >
    {(props)=> (
        <div className='contain'>
        <div className="card">
        <h5 className="card-title">Login Form</h5>
        <div className="card-body">
        <form onSubmit={props.handleSubmit}>
            <div className="form-group">
            <label>User Name:</label>
            <input type="text" className="form-control"onChange={props.handleChange} name="UserName" value={props.values.UserName}></input>
            </div>
            <div className="form-group">
            <label>Password:</label>
            <input type="text" className="form-control"onChange={props.handleChange} name="Password"value={props.values.Password}></input>
            </div>
            <div className="button">
            <Button type="submit" className="btn-lg btn-block">Submit</Button>
            </div>
            <div className="avatar">
            <Avatar src={avatar} round={true} size="100"/>
            </div>
            </form>
        </div>
      </div>
      </div>
    )
    }
 </Formik>
);
export default Login;
